scriptlet.script:
var ipVersion = scriptletContext.get("ipVersion");
var pingCommand = "ping";

if(!((ipVersion == "") || (typeof(ipVersion) == 'undefined'))){
	if (ipVersion.trim().equals("6")){
		pingCommand = "ping6";
	}
}

scriptletContext.put("pingCommand", pingCommand);

scriptletResult="";
var parts = scriptletInput.split(/=/);
if(parts.length > 1){
var names = parts[0].split(/\//);
var vals = parts[1].split(/\//);
for (count = 0; count < names.length; count++){
	curr = names[count].replace(/\s$/, "").replace(/^\s/, "").toLowerCase();
	if (curr == "stddev" || curr == "standard deviation" ||  curr == "deviation" || curr=="mdev"){
		scriptletResult=vals[count];
	break;
	}
}
}

scriptletResult="";
